export const useContractsStore = defineStore('contracts', () => {
  const contracts = ref<Contract[]>(JSON.parse(JSON.stringify(mockContracts)))
  const isLoading = ref(false)
  const filters = ref<ContractFilters>({})

  const filteredContracts = computed(() => {
    return contracts.value.filter(contract => {
      if (filters.value.status && contract.status !== filters.value.status) {
        return false
      }
      if (filters.value.search) {
        const search = filters.value.search.toLowerCase()
        if (!contract.studentFullName.toLowerCase().includes(search) &&
            !contract.courseTitle.toLowerCase().includes(search) &&
            !contract.contractNumber.toLowerCase().includes(search)) {
          return false
        }
      }
      if (filters.value.typeId && contract.typeId !== filters.value.typeId) {
        return false
      }
      return true
    })
  })

  const getContractById = computed(() => {
    return (id: string) => contracts.value.find(c => c.id === id)
  })

  const getUserContracts = computed(() => {
    return (userId: string) => contracts.value.filter(c => c.userId === userId)
  })

  const setFilters = (newFilters: ContractFilters) => {
    filters.value = { ...filters.value, ...newFilters }
  }

  const clearFilters = () => {
    filters.value = {}
  }

  const fetchContracts = async () => {
    isLoading.value = true
    try {
      await new Promise(resolve => setTimeout(resolve, 500))
      return contracts.value
    } finally {
      isLoading.value = false
    }
  }

  const createContract = async (userId: string, data: Omit<Contract, 'id' | 'createdAt' | 'updatedAt' | 'status'>) => {
    isLoading.value = true
    try {
      await new Promise(resolve => setTimeout(resolve, 700))

      const newContract: Contract = {
        ...data,
        id: String(Date.now()),
        userId,
        status: 'draft',
        createdAt: new Date(),
        updatedAt: new Date()
      }

      contracts.value.push(newContract)
      return newContract
    } finally {
      isLoading.value = false
    }
  }

  const updateContract = async (id: string, data: Partial<Contract>) => {
    isLoading.value = true
    try {
      await new Promise(resolve => setTimeout(resolve, 600))

      const index = contracts.value.findIndex(c => c.id === id)
      if (index === -1) throw new Error('Договор не найден')

      contracts.value[index] = {
        ...contracts.value[index],
        ...data,
        updatedAt: new Date()
      }

      return contracts.value[index]
    } finally {
      isLoading.value = false
    }
  }

  const submitContract = async (id: string) => {
    isLoading.value = true
    try {
      await new Promise(resolve => setTimeout(resolve, 600))

      const index = contracts.value.findIndex(c => c.id === id)
      if (index === -1) throw new Error('Договор не найден')

      contracts.value[index] = {
        ...contracts.value[index],
        status: 'submitted',
        submittedAt: new Date(),
        updatedAt: new Date()
      }

      return contracts.value[index]
    } finally {
      isLoading.value = false
    }
  }

  const approveContract = async (id: string, comment?: string) => {
    isLoading.value = true
    try {
      await new Promise(resolve => setTimeout(resolve, 600))

      const index = contracts.value.findIndex(c => c.id === id)
      if (index === -1) throw new Error('Договор не найден')

      contracts.value[index] = {
        ...contracts.value[index],
        status: 'approved',
        adminComment: comment,
        approvedAt: new Date(),
        updatedAt: new Date()
      }

      return contracts.value[index]
    } finally {
      isLoading.value = false
    }
  }

  const rejectContract = async (id: string, reason: string) => {
    isLoading.value = true
    try {
      await new Promise(resolve => setTimeout(resolve, 600))

      const index = contracts.value.findIndex(c => c.id === id)
      if (index === -1) throw new Error('Договор не найден')

      contracts.value[index] = {
        ...contracts.value[index],
        status: 'rejected',
        rejectionReason: reason,
        updatedAt: new Date()
      }

      return contracts.value[index]
    } finally {
      isLoading.value = false
    }
  }

  const deleteContract = async (id: string) => {
    isLoading.value = true
    try {
      await new Promise(resolve => setTimeout(resolve, 500))

      const index = contracts.value.findIndex(c => c.id === id)
      if (index === -1) throw new Error('Договор не найден')

      contracts.value.splice(index, 1)
    } finally {
      isLoading.value = false
    }
  }

  const getContractStats = () => {
    const stats = {
      total: contracts.value.length,
      byStatus: {
        draft: contracts.value.filter(c => c.status === 'draft').length,
        submitted: contracts.value.filter(c => c.status === 'submitted').length,
        approved: contracts.value.filter(c => c.status === 'approved').length,
        rejected: contracts.value.filter(c => c.status === 'rejected').length
      }
    }
    return stats
  }

  return {
    contracts,
    filteredContracts,
    isLoading,
    filters,
    getContractById,
    getUserContracts,
    setFilters,
    clearFilters,
    fetchContracts,
    createContract,
    updateContract,
    submitContract,
    approveContract,
    rejectContract,
    deleteContract,
    getContractStats
  }
})
